const Loglist = (props) => {
    return(
        <tr>
        {props.logs.map(log => (
            <Logitem
              key={place.id}
              id={place.id}
              image={place.image}
              title={place.title}
              description={place.description}
              address={place.address}
              creatorId={place.creator}
              coordinates={place.location}
              onDelete={props.onDeletePlace}
            />
          ))}
          </tr>
    )
}


export default Loglist;
